viders: [ConfirmationService, MessageService], // Servicios disponibles para el componente y sus hijos\n})\nexport class AppComponent {\n  title = 'Sistema de Encuestas'; // Ttulo de la aplicacin\n  currentRoute = ''; // Ruta actual para navegacin dinmica\n\n  private router = inject(Router);\n\n  constructor() {\n    // Suscribirse a los cambios de ruta para actualizar la navegacin\n    this.router.events\n      .pipe(filter(event => event instanceof NavigationEnd))\n      .subscribe((event: NavigationEnd) => {\n        this.currentRoute = event.url;\n      });\n  }\n\n  // Mtodo para verificar si estamos en la pgina de inicio\n  isHomePage(): boolean {\n    return this.currentRoute === '/' || this.currentRoute === '';\n  }\n\n  // Mtodo para verificar si estamos en la pgina de creacin\n  isCreationPage(): boolean {\n    return this.currentRoute === '/creacion';\n  }\n\n  // Mtodo para verificar si estamos en la pgina de presentacin de enlaces\n  isPresentacionEnlacesPage(): boolean {\n    return this.currentRoute.includes('/presentacion-enlaces');\n  }\n\n  // Mtodo para verificar si estamos en la pgina de responder encuesta\n  isResponderEncuestaPage(): boolean {\n    return this.currentRoute.includes('/responder/');\n  }\n\n  // Mtodo para verificar si estamos en la pgina de resultados\n  isResultadosPage(): boolean {\n    return this.currentRoute.includes('/resultados/');\n  }\n\n  // Mtodo para verificar si debemos mostrar header y footer\n  shouldShowHeaderFooter(): boolean {\n    return !this.isPresentacionEnlacesPage() &&\n           !this.isResponderEncuestaPage() &&\n           !this.isResultadosPage();\n  }\n\n  // Mtodo para navegar a una ruta especfica\n  navigateTo(route: string): void {\n    this.router.navigate([route]);\n  }\n}\n\n    \n\n    \n        \n\n  \n    \n      \n      Sistema de Encuestas\n    \n    \n      \n        \n        \n          \n            \n            Crear Encuesta\n          \n        \n\n        \n        \n          \